<!DOCTYPE html>
<html>
    <head>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <meta name="description" content="">
        <meta name="author" content="">
        <!--[if IE]>
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
        <![endif]-->
        <title>ENCURTAEU | ERRO 404</title>

        <!--ADDING THE REQUIRED STYLE SHEETS-->

        <link type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/3.3.7/css/bootstrap.css" rel="stylesheet">  <!--BOOTSTRAP 3 CSS FILE-->
        <link href='http://fonts.googleapis.com/css?family=Open+Sans:400,600,700,800' rel='stylesheet' type='text/css'> <!-- Google web font link-->
        <link type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.css" rel="stylesheet"> <!--Font Awesome CSS FILE-->        
        <link type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/animate.css/2.0/animate.min.css" rel="stylesheet">  <!--animate.css FILE-->

        <style>
            /*======= Basic Rules ===============*/
            body{
                font-family: 'Open Sans', sans-seriff;
                font-size: 14px;
                color: #374c6d;
                background: url('data:image/png;base64,');
                background-repeat: repeat;   
            }

            h1,h2,h3,h4,h5,h6{
                font-family: 'Open Sans', sans-seriff;
                font-weight: 700;
            }

            h1{font-size: 150px; margin-top: 0px;}

            .center{
                text-align: center;
            }

            .capital{
                text-transform: uppercase;
            }

            .f1{font-size: 34px}

            #cflask-holder span{
                min-width: 150px;
                min-height: 150px;
                width: 150px;
                display: block;
                background-color: #fff;
                margin:0px auto;
                text-align: center;
                border-radius: 150px;
                position: relative;
            }

            #cflask-holder span i{
                padding: 40px 0px 0px 0px;
                font-size: 80px;
            }

            .row1 p{
                font-size: 35px;
            }     

            section{
                margin-top: 30px;
            }

            #botao{background-color: #374c6d; border-color: #374c6d; width: 250px; font-size: 19px;}
        </style>

        <!-- HTML5 shiv and Respond.js IE8 support of HTML5 elements and media queries -->
        <!--[if lt IE 9]>
          <script src="https://oss.maxcdn.com/libs/html5shiv/3.7.0/html5shiv.js"></script>
          <script src="https://oss.maxcdn.com/libs/respond.js/1.3.0/respond.min.js"></script>
        <![endif]-->

    </head>
    <body>

        <section>
            <div class="container">
                <div class="row row1">
                    <div class="col-md-12">
                        <h3 class="center capital f1 wow fadeInLeft" data-wow-duration="2s">Algo deu errado!</h3>
                        <h1 id="error" class="center wow fadeInRight" data-wow-duration="2s" data-from="0" data-to="404" data-speed="999" data-refresh-interval="50"></h1>
                        <p class="center wow bounceIn" data-wow-delay="2s">Página não encontrada!</p>
                    </div>
                </div>

                <div class="row">
                    <div class="col-md-12">
                        <div id="cflask-holder" class="wow fadeIn" data-wow-delay="2800ms">
                            <span class="wow tada" data-wow-delay="3000ms"><i class="fa fa-warning fa-5x graduation-cap wow flip" data-wow-delay="3300ms"></i>                                 
                            </span>
                        </div>
                    </div>
                </div>

                <br><br>
                <div class="text-center">
                <a href="http://encurtaeu.tk" class="btn btn-success wow fadeIn capital center" id="botao" data-wow-delay="3700ms">Voltar à página inicial</a>
                </div>
            </div>
        </section>

        <!--ADDING THE REQUIRED SCRIPT FILES-->
        <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/jquery/1.10.1/jquery.min.js"></script>
        <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/jquery-countto/1.2.0/jquery.countTo.min.js"></script>
        <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/wow/1.1.2/wow.min.js"></script>        

        <script type="text/javascript">
            $('#error').countTo();
        </script>

        <!--Initiating the Wow Script-->
        <script>
            "use strict";
            var wow = new WOW(
                    {
                        animateClass: 'animated',
                        offset: 100
                    }
            );
            wow.init();
        </script>


    </body>
</html>
